import { Route, Switch } from 'react-router';
import Home from './pages/Home';
import Question from './pages/Question';
import Wait from './pages/Wait';

const App = () => {
  return (
    <div className="a-container a-container--gutter py-10">
      <Switch>
        <Route exact path="/">
          <Home />
        </Route>
        <Route path="/wait">
          <Wait />
        </Route>
        <Route path="/question">
          <Question />
        </Route>
      </Switch>
    </div>
  );
};


export default App;
